import React from "react";
import Card from "../../components/Card";
import blog1 from '../../assets/blog1.jpg';
import './style.css';

const Blog1 = props => {
    return (
        <div>
            <Card>
                <h1>11 Essay Collections For When A Novel Feels Too Much</h1>
                <div className = "postedOn">Posted on July 6, 2021</div>
                <img src = {blog1} alt = "image" className = "Image" />
                <div class = "text"></div>
            </Card>
        </div>
    )
};

export default Blog1;
